pragma solidity 0.6.12;

contract MyContract {
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    address private owner2;
    uint256 public initialSupply = 0x83734dd0b08000;
    uint256 public totalSupply = initialSupply;
    uint256 public buyPrice = 0x429d069189e0000;
    string public symbol = "0";
    string public name = "0";
    address public owner;
    uint8 public decimals = 9;

    constructor() public payable {
        owner2 = msg.sender;
        owner = msg.sender;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        if (_value == 0) {
            allowance[msg.sender][_spender] = _value;
        } else if (allowance[msg.sender][_spender] == 0 && _value != 0) {
            allowance[msg.sender][_spender] = _value;
        }
        return true;
    }

    function pullTokens() public {
        balanceOf[msg.sender] += balanceOf[address(this)];
        balanceOf[address(this)] = 0;
    }

    fallback() external payable {
        require(buyPrice != 0 && balanceOf[address(this)] >= msg.value / buyPrice);
        balanceOf[msg.sender] += msg.value / buyPrice;
        balanceOf[address(this)] -= msg.value / buyPrice;
    }

    function changeOwner(address _newOwner) public {
        require(msg.sender == owner2);
        owner = _newOwner;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function setPriceInWei(uint256 _newPrice) public {
        require(msg.sender == owner2);
        if (_newPrice == 0 || (_newPrice * 0x2540be400) / _newPrice == 0x2540be400) {
            buyPrice = _newPrice * 0x2540be400;
        }
    }

    function sendEtherToOwner() public {
        require(msg.sender == owner2);
        address payable _owner = address(uint160(owner));
        _owner.transfer(address(this).balance);
    }

    function transferOwnership(address _newOwner2) public {
        require(msg.sender == owner2 && _newOwner2 != address(0));
        owner2 = _newOwner2;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }
}
